let rec_cont=document.querySelector('.rec-logos')



logosData.map(function(el){

   
    let div =document.createElement("div");

    let img= document.createElement('img');

    img.src=el.img;

    img.setAttribute("class","logosImg")

    div.append(img);
    rec_cont.append(div);
})

